import React from 'react';

function Home() {
  return (
    <div className="text-center">
      <div className="m-6 p-6 rounded shadow-lg">

        <a
          className="text-base"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </div>
    </div>
  );
}

export default Home;
